/*  */
const utils = require('./utils.js');

/** Class for config node */
class FMConfig {

    /**
     * constructor
     * @param {Id} id
     * @constructor
     */
    constructor(id) {
        /**
         * Id of the Config node
         * @public
         */
        this.id = id || utils.genId();
        /**
         * Type of the Config node
         * @public
         */
        this.type = "";
    }
}

module.exports = FMConfig;
